/* global jsPDF */
sap.ui.define([
	"sap/ui/base/Object"
], function (BaseObject) {
	"use strict";
	return BaseObject.extend("com.novonordisk.ibr.BatchStatusAssignmentApp.controller.PDFGenerator", {
		
		generateBatchAssignmentPDF: function(mBatchInformation) {
			var oDate = new Date();
			var sFormattedDate = oDate.getUTCFullYear() + "-" + (oDate.getUTCMonth() + 1) + "-" + oDate.getUTCDate();
			var doc = new jsPDF(); //eslint-disable-line new-cap
			var imgData =
				"data:image/jpeg;base64,";
			var base = 40;
			doc.addImage(imgData, "JPEG", 20, 5, 15, 10);
			doc.setFontSize(8);
			doc.text(190, 7, "Novo Nordisk", "right");
			doc.text(190, 12, "Batch Status Assignment", "right");
			doc.text(190, 17, sFormattedDate, "right");
			doc.line(20, 20, 190, 20);
			doc.setFontSize(22);
			doc.text(20, base, "Batch: " + mBatchInformation.batchNumber);
			doc.setFontSize(12);
			doc.text(20, base + 10, "Material No.: " + mBatchInformation.materialNumber);
			doc.text(90, base + 10, "Batch Summary Status: " + mBatchInformation.summaryStatus);
			doc.text(160, base + 10, "Site: " + mBatchInformation.site);
			doc.text(20, base + 20, "Manufacture Date: " + mBatchInformation.dateOfManufacture);
			doc.text(90, base + 20, "SAP Batch Status: " + mBatchInformation.batchStatus);
			doc.text(160, base + 20, "Building: " + mBatchInformation.building);
			doc.text(20, base + 30, "Plant: " + mBatchInformation.plant);
			//doc.line(10, base + 50, 200, base + 50)
			//doc.save("test");
			return doc.output("blob");
		}
		
	});
});